import React from 'react'
import styled from 'styled-components'
import { Twitter, Send } from 'react-feather'

const SocialLinksWrapper = styled.div`
  display: flex;
  align-items: center;
  margin-left: 0.5rem;
`

const SocialLink = styled.a`
  color: ${({ theme }) => theme.text1};
  padding: 0.35rem 0.6rem;
  border-radius: 12px;
  text-decoration: none;
  background: ${({ theme }) => theme.bg3};
  margin-right: 0.5rem;

  :hover {
    color: ${({ theme }) => theme.text2};
    cursor: pointer;
  }

  :last-child {
    margin-right: 0;
  }

  svg {
    width: 20px;
    height: 20px;
  }
`

export default function SocialLinks() {
  return (
    <SocialLinksWrapper>
      <SocialLink href="https://x.com/fomo_swap" target="_blank" rel="noopener noreferrer">
        <Twitter />
      </SocialLink>
      <SocialLink href="https://t.me/fomo_swap" target="_blank" rel="noopener noreferrer">
        <Send />
      </SocialLink>
    </SocialLinksWrapper>
  )
}
